import React from 'react';
import { useEffect } from "react";
import Card from "./Card.js"

const cardlist = ({robots2,hello2} )=> {

    useEffect(() =>{    

    trackPromise(
    fetch('https://api.pokemontcg.io/v2/cards?page=1&pageSize=100s').then(response => response.json()).then(users =>{
        setrobots2(users.data)
    }))
})

    return(
        <div>
            {
                robots2.map( (user,i)=>{
                    return <Card key={robots2[i].id} id={robots2[i].id} hello={hello2} name2={robots2[i].images.small} />
                } )
            }
        </div>
    )
}

export default cardlist
